import React from 'react';
import Link from './navigationLink';

const navigationLinks = () => (
    <ul className="desktopView">
        <Link linkName="Home"/>
        <Link linkName="Products"/>
        <Link linkName="User"/>
    </ul>
);

export default navigationLinks;
